  \"windom-wetland-management-district-comprehensive-conservation-plan-and-environmental-asses\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Windom Wetland Management District for the next
  15 years. This plan outlines the District vision and purpose and describes how Windom
  Wetland Management District will contribute to the overall mission of the Refuge
  System. The plan provides an introduction to the WMD, an overview of the CCP process,
  information about the environment, goals and objectives, information about the management
  direction, and strategies for implementation. Key planning issues include: wildlife
  and habitat, public use, and operations.\",\n\t\"license_title\": \"License Not
